
SELECT Tum.UyeID, Tum.marka, Tum.IsyeriTipi, Tum.Sektor, Tum.UyeAktivasyonTarihi, Tum.UyeDeaktivasyonTarihi, Tum.UyeDurum, GROUP_CONCAT(Tum.SerialNo) as Hizmetler, GROUP_CONCAT(Tum.Tedarikci) as Tedarikciler, GROUP_CONCAT(Tum.HizmetDurum) as HizmetDurumlar, SUM(Tum.IslemAdet) as ToplamIslemAdet, SUM(Tum.Ciro) as ToplamCiro, MAX(Tum.SonIslemTarih) as SonIslemTarih, SUM(Tum.OdenmeyenToplamFatura) as OdenmeyenToplamFaturaAdet, MAX(Tum.SonFaturaDonem) as SonFaturaDonemi, 
MAX(Tum.FaturaDurum) as SonFaturaDurum
FROM (
SELECT *
FROM (
SELECT o.id as UyeID, o.marka, CASE 
WHEN o.businessType=0 THEN "Bireysel" 
WHEN o.businessType=1 THEN "Şahıs" 
WHEN o.businessType=2 THEN "Tüzel" 
WHEN o.businessType=3 THEN "Dernek vb"
ELSE "Bilinmeyen" 
END as IsyeriTipi,
s3.sector_name as Sektor,
o.activatedAt as UyeAktivasyonTarihi, 
o.deActivatedAt as UyeDeaktivasyonTarihi, 
IF(o.isActivated=0,"Pasif","Aktif") as UyeDurum, 
t.serial_no as SerialNo, t.supplier as Tedarikci, 
IF(t.terminalStatus=1,"Aktif","Pasif") as HizmetDurum, COUNT(bp.id) as IslemAdet, SUM(bp.amount) as Ciro, MAX(bp.signedDate) as SonIslemTarih, Fatura.OdenmeyenToplamFatura, Fatura.SonFaturaDonem, Fatura.FaturaDurum
FROM odeal.Organisation o 
JOIN odeal.Sector s3 ON s3.id = o.sectorId
JOIN odeal.Terminal t ON t.organisation_id = o.id
JOIN subscription.Subscription s ON s.id = t.subscription_id
LEFT JOIN (SELECT i.organisationId as UyeID, COUNT(i.id) as OdenmeyenToplamFatura, DATE_FORMAT(MAX(i.periodEnd),"%Y-%m") as SonFaturaDonem, 
CASE WHEN i.invoiceStatus=0 THEN "ÖDENMEDİ" WHEN i.invoiceStatus=1 THEN "ÖDENDİ" WHEN i.invoiceStatus=2 THEN "ÖDENMEYECEK" END as FaturaDurum FROM subscription.Invoice i 
WHERE i.invoiceStatus = 0
GROUP BY i.organisationId) as Fatura ON Fatura.UyeID = o.id 
LEFT JOIN odeal.BasePayment bp ON bp.organisationId = o.id AND bp.currentStatus = 6 AND bp.signedDate >= DATE_FORMAT(DATE_SUB(CURDATE(),INTERVAL 1 MONTH),"%Y-%m-01") AND bp.signedDate <= NOW()
WHERE o.demo = 0 AND bp.serviceId <>3
GROUP BY o.id, t.serial_no, t.supplier, t.firstActivationDate, s.activationDate, s.cancelledAt, t.terminalStatus
UNION
SELECT CeptePos.UyeID,CeptePos.marka,
CeptePos.IsyeriTipi,
CeptePos.Sektor,
CeptePos.UyeAktivasyonTarihi, 
CeptePos.UyeDeaktivasyonTarihi,
CeptePos.UyeDurum, 
CeptePos.SerialNo, 
CeptePos.Tedarikci, 
CeptePos.HizmetDurum, 
CeptePos.IslemAdet,
CeptePos.Ciro,
CeptePos.SonIslemTarih,
CeptePos.OdenmeyenToplamFatura,
CeptePos.SonFaturaDonem,
CeptePos.FaturaDurum
FROM (
SELECT o.id as UyeID,o.marka, CASE 
WHEN o.businessType=0 THEN "Bireysel" 
WHEN o.businessType=1 THEN "Şahıs" 
WHEN o.businessType=2 THEN "Tüzel" 
WHEN o.businessType=3 THEN "Dernek vb"
ELSE "Bilinmeyen" 
END as IsyeriTipi, s3.sector_name as Sektor, o.activatedAt as UyeAktivasyonTarihi, o.deActivatedAt as UyeDeaktivasyonTarihi, IF(o.isActivated=0,"Pasif","Aktif") as UyeDurum,
"CEPTEPOS" as SerialNo, s2.name as Tedarikci, IF(s.status=1,"Aktif","Pasif") as HizmetDurum, 
COUNT(bp.id) as IslemAdet, SUM(bp.amount) as Ciro, MAX(bp.signedDate) as SonIslemTarih,Fatura.OdenmeyenToplamFatura, Fatura.SonFaturaDonem, Fatura.FaturaDurum,
ROW_NUMBER() OVER (PARTITION BY o.id ORDER BY s.id DESC) as sira
FROM odeal.Organisation o 
JOIN odeal.Sector s3 ON s3.id = o.sectorId
JOIN subscription.Subscription s ON s.organisationId = o.id
JOIN subscription.Plan p ON p.id = s.planId 
JOIN subscription.Service s2 ON s2.id = p.serviceId 
LEFT JOIN (SELECT i.organisationId as UyeID, COUNT(i.id) as OdenmeyenToplamFatura, DATE_FORMAT(MAX(i.periodEnd),"%Y-%m") as SonFaturaDonem, 
CASE WHEN i.invoiceStatus=0 THEN "ÖDENMEDİ" WHEN i.invoiceStatus=1 THEN "ÖDENDİ" WHEN i.invoiceStatus=2 THEN "ÖDENMEYECEK" END as FaturaDurum FROM subscription.Invoice i 
WHERE i.invoiceStatus = 0
GROUP BY i.organisationId) as Fatura ON Fatura.UyeID = o.id 
LEFT JOIN odeal.BasePayment bp ON o.id = bp.organisationId AND bp.currentStatus = 6 AND bp.signedDate >= DATE_FORMAT(DATE_SUB(CURDATE(),INTERVAL 1 MONTH),"%Y-%m-01") AND bp.signedDate <= NOW()
WHERE p.serviceId = 3 AND bp.serviceId = 3 AND o.demo = 0
GROUP BY o.id, s.id) as CeptePos
WHERE CeptePos.sira =1) as T1) as Tum WHERE Tum.UyeDurum = "Aktif"
