SELECT bp.organisationId, COUNT(bp.id), SUM(bp.amount) FROM odeal.BasePayment bp WHERE bp.organisationId = 301000255 AND bp.currentStatus = 6 AND bp.signedDate >= DATE_FORMAT(DATE_SUB(CURDATE(),INTERVAL 1 MONTH),"%Y-%m-01") AND bp.signedDate <= NOW()
