SELECT CeptePos.UyeID, CeptePos.marka, 
CeptePos.IsyeriTipi,
CeptePos.Sektor,
CeptePos.activatedAt, 
CeptePos.deActivatedAt,
CeptePos.UyeDurum, 
CeptePos.SerialNo, 
CeptePos.Tedarikci, 
CeptePos.AktivasyonTarihi, 
CeptePos.activationDate, 
CeptePos.cancelledAt, 
CeptePos.HizmetDurum, 
CeptePos.IslemAdet,
CeptePos.Ciro,
CeptePos.SonIslemTarih
FROM (
SELECT o.id as UyeID, o.marka, CASE 
WHEN o.businessType=0 THEN "Bireysel" 
WHEN o.businessType=1 THEN "Şahıs" 
WHEN o.businessType=2 THEN "Tüzel" 
WHEN o.businessType=3 THEN "Dernek vb"
ELSE "Bilinmeyen" 
END as IsyeriTipi, s3.sector_name as Sektor, o.activatedAt, o.deActivatedAt, IF(o.isActivated=0,"Pasif","Aktif") as UyeDurum,
s.id as SerialNo, s2.name as Tedarikci, s.activationDate as AktivasyonTarihi, s.activationDate, s.cancelledAt,  IF(s.status=1,"Aktif","Pasif") as HizmetDurum, 
COUNT(bp.id) as IslemAdet, SUM(bp.amount) as Ciro, MAX(bp.signedDate) as SonIslemTarih,Fatura.OdenmeyenToplamFatura, Fatura.SonFaturaDonem, Fatura.FaturaDurum,
ROW_NUMBER() OVER (PARTITION BY o.id ORDER BY s.id DESC) as sira
FROM odeal.Organisation o 
LEFT JOIN odeal.Sector s3 ON s3.id = o.sectorId
JOIN subscription.Subscription s ON s.organisationId = o.id
JOIN subscription.Plan p ON p.id = s.planId 
JOIN subscription.Service s2 ON s2.id = p.serviceId 
LEFT JOIN (SELECT i.organisationId as UyeID, COUNT(i.id) as OdenmeyenToplamFatura, MAX(i.period) as SonFaturaDonem, CASE WHEN i.invoiceStatus=0 THEN "ÖDENMEDİ" WHEN i.invoiceStatus=1 THEN "ÖDENDİ" WHEN i.invoiceStatus=2 THEN "ÖDENMEYECEK" END as FaturaDurum FROM subscription.Invoice i 
WHERE i.invoiceStatus = 0
GROUP BY i.organisationId) as Fatura ON Fatura.UyeID = o.id 
LEFT JOIN odeal.BasePayment bp ON o.id = bp.organisationId AND bp.serviceId = 3 AND bp.currentStatus = 6 AND bp.signedDate >= DATE_FORMAT(DATE_SUB(CURDATE(),INTERVAL 1 MONTH),"%Y-%m-01") AND bp.signedDate <= NOW()
LEFT JOIN odeal.Payment p2 ON p2.id = bp.id
WHERE p.serviceId = 3 AND o.demo = 0 AND s.status=1 
GROUP BY o.id, s.id) as CeptePos
WHERE CeptePos.sira =1 AND CeptePos.UyeID = 301000195

