SELECT *, 
COUNT(CASE WHEN Fatura.FaturaDurum="ÖDENDİ" THEN Fatura.terminalId END) OVER (PARTITION BY Fatura.Donem, Fatura.organisationId, Fatura.terminalId) as OdendiDonemAdet, 
SUM(CASE WHEN Fatura.FaturaDurum="ÖDENDİ" THEN Fatura.OdendiTutar END) OVER (PARTITION BY Fatura.Donem, Fatura.organisationId, Fatura.terminalId) as OdendiDonemTutar,
COUNT(CASE WHEN Fatura.FaturaDurum="ÖDENMEDİ" THEN Fatura.terminalId END) OVER (PARTITION BY Fatura.Donem, Fatura.organisationId, Fatura.terminalId) as OdenmediDonemAdet, 
SUM(CASE WHEN Fatura.FaturaDurum="ÖDENMEDİ" THEN Fatura.OdenmeyenTutar END) OVER (PARTITION BY Fatura.Donem, Fatura.organisationId, Fatura.terminalId) as OdenmediDonemTutar,
COUNT(CASE WHEN Fatura.FaturaDurum="ÖDENMEYECEK" THEN Fatura.terminalId END) OVER (PARTITION BY Fatura.Donem, Fatura.organisationId, Fatura.terminalId) as OdenmeyecekDonemAdet, 
SUM(CASE WHEN Fatura.FaturaDurum="ÖDENMEYECEK" THEN Fatura.OdenmeyecekTutar END) OVER (PARTITION BY Fatura.Donem, Fatura.organisationId, Fatura.terminalId) as OdenmeyecekDonemTutar
FROM (
SELECT DISTINCT i.subscriptionId as FaturaAbonelik, DATE_FORMAT(i.period,"%Y-%m") as Donem,  
CASE WHEN i.invoiceStatus=0 THEN "ÖDENMEDİ" WHEN i.invoiceStatus=1 THEN "ÖDENDİ" WHEN i.invoiceStatus=2 THEN "ÖDENMEYECEK" END as FaturaDurum,
 i.organisationId, sh.terminalId, sh.subscriptionId, t.serial_no, 
COUNT(CASE WHEN i.invoiceStatus = 0 THEN i.id END) OVER (PARTITION BY o.id, t.id, DATE_FORMAT(i.period,"%Y-%m")) as OdenmeyenAdet,
SUM(CASE WHEN i.invoiceStatus = 0 THEN i.totalAmount END) OVER (PARTITION BY o.id, t.id, DATE_FORMAT(i.period,"%Y-%m")) as OdenmeyenTutar,
COUNT(CASE WHEN i.invoiceStatus = 1 THEN i.id END) OVER (PARTITION BY o.id, t.id, DATE_FORMAT(i.period,"%Y-%m")) as OdendiAdet,
SUM(CASE WHEN i.invoiceStatus = 1 THEN i.totalAmount END) OVER (PARTITION BY o.id, t.id, DATE_FORMAT(i.period,"%Y-%m")) as OdendiTutar,
COUNT(CASE WHEN i.invoiceStatus = 2 THEN i.id END) OVER (PARTITION BY o.id, t.id, DATE_FORMAT(i.period,"%Y-%m")) as OdenmeyecekAdet,
SUM(CASE WHEN i.invoiceStatus = 2 THEN i.totalAmount END) OVER (PARTITION BY o.id, t.id, DATE_FORMAT(i.period,"%Y-%m")) as OdenmeyecekTutar
FROM subscription.Invoice i 
LEFT JOIN subscription.SubscriptionHistory sh ON sh.subscriptionId = i.subscriptionId
LEFT JOIN odeal.Terminal t ON t.id = sh.terminalId
JOIN odeal.Organisation o ON o.id = i.organisationId AND o.demo = 0
WHERE sh.terminalId IS NOT NULL AND o.id = 301145544
GROUP BY DATE_FORMAT(i.period,"%Y-%m"), i.subscriptionId, sh.terminalId, i.invoiceStatus, i.id) as Fatura WHERE Fatura.Donem = "2024-03"

SELECT * FROM subscription.Invoice i WHERE i.id IN( 2842482,2809861)

AND o.id = 301000162 AND t.serial_no = "PAX710025169"


SELECT * FROM
(SELECT DISTINCT i.subscriptionId as FaturaAbonelik, DATE_FORMAT(i.period,"%Y-%m") as Donem,  
CASE WHEN i.invoiceStatus=0 THEN "ÖDENMEDİ" WHEN i.invoiceStatus=1 THEN "ÖDENDİ" WHEN i.invoiceStatus=2 THEN "ÖDENMEYECEK" END as FaturaDurum,
 i.organisationId, sh.terminalId, sh.subscriptionId, t.serial_no, i.period, i.id, i.totalAmount,
COUNT(CASE WHEN i.invoiceStatus = 0 THEN i.id END) OVER (PARTITION BY o.id, t.id, DATE_FORMAT(i.period,"%Y-%m")) as OdenmeyenAdet,
SUM(CASE WHEN i.invoiceStatus = 0 THEN i.totalAmount END) OVER (PARTITION BY o.id, t.id, DATE_FORMAT(i.period,"%Y-%m")) as OdenmeyenTutar,
COUNT(CASE WHEN i.invoiceStatus = 1 THEN i.id END) OVER (PARTITION BY o.id, t.id, DATE_FORMAT(i.period,"%Y-%m")) as OdendiAdet,
SUM(CASE WHEN i.invoiceStatus = 1 THEN i.totalAmount END) OVER (PARTITION BY o.id, t.id, DATE_FORMAT(i.period,"%Y-%m")) as OdendiTutar,
COUNT(CASE WHEN i.invoiceStatus = 2 THEN i.id END) OVER (PARTITION BY o.id, t.id, DATE_FORMAT(i.period,"%Y-%m")) as OdenmeyecekAdet,
SUM(CASE WHEN i.invoiceStatus = 2 THEN i.totalAmount END) OVER (PARTITION BY o.id, t.id, DATE_FORMAT(i.period,"%Y-%m")) as OdenmeyecekTutar
FROM subscription.Invoice i 
LEFT JOIN subscription.SubscriptionHistory sh ON sh.subscriptionId = i.subscriptionId
LEFT JOIN odeal.Terminal t ON t.id = sh.terminalId
JOIN odeal.Organisation o ON o.id = i.organisationId AND o.demo = 0
WHERE sh.terminalId IS NOT NULL AND o.id = 301224654
GROUP BY DATE_FORMAT(i.period,"%Y-%m"), i.subscriptionId, sh.terminalId, i.invoiceStatus, i.id) as Fatura 

SELECT t.organisation_id, t.serial_no, bp.id, bp.signedDate, bp.amount,
ROW_NUMBER() OVER (PARTITION BY t.organisation_id, t.serial_no ORDER BY bp.signedDate DESC) as Sira
FROM odeal.Terminal t 
LEFT JOIN odeal.TerminalPayment tp ON tp.terminal_id = t.id 
LEFT JOIN odeal.BasePayment bp ON bp.id = tp.id 
WHERE bp.currentStatus = 6 AND bp.signedDate >= DATE_FORMAT(DATE_SUB(CURDATE(),INTERVAL 1 MONTH),"%Y-%m-01") AND bp.signedDate < NOW() AND t.serial_no = "PAX710046285"

BCJ00033893,2C19669275

SELECT t.organisation_id, t.serial_no, t.terminalStatus, MAX(bp.signedDate),
SUM(bp.amount), COUNT(bp.id) FROM odeal.BasePayment bp 
JOIN odeal.TerminalPayment tp ON tp.id = bp.id 
JOIN odeal.Terminal t ON t.id = tp.terminal_id
WHERE bp.currentStatus = 6 AND t.serial_no = "2C19669275"
GROUP BY t.organisation_id, t.serial_no, t.terminalStatus

SELECT o.id as UyeID, CASE 
WHEN o.businessType=0 THEN "Bireysel" 
WHEN o.businessType=1 THEN "Şahıs" 
WHEN o.businessType=2 THEN "Tüzel" 
WHEN o.businessType=3 THEN "Dernek vb"
ELSE "Bilinmeyen" 
END as IsyeriTipi,
o.activatedAt as UyeAktivasyonTarihi, o.marka as Marka, s.sector_name as Sektor, IF(o.isActivated=1,"Aktif","Pasif") as UyeDurum, MAX(Ceptepos.AboneDurum) as CeptePos,
GROUP_CONCAT(t.serial_no) as FizikiHizmetler, GROUP_CONCAT(IF(t.terminalStatus=1,"Aktif","Pasif")) as FizikiHizmetDurumlar,
